import { Button, Container, TextField } from "@material-ui/core";
import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import MyTable from "../Components/MyTable";
import { getTeacher } from "../Redux/app/action";
import { useHistory } from "react-router-dom";

export default function Dashboard() {
  const history = useHistory();
  const token = useSelector((state) => state.auth.token);
  const teachers = useSelector((state) => state.app.teachers);
  const dispatch = useDispatch();
  const [search, setSearch] = useState("");
  const [page, setPage] = useState(1);
  const handleTeacherClick = (id) => {
    history.push(`/teacher/${id}`);
  };
  const handleSearch = () => {
    dispatch(getTeacher(token, search, page));
  };
  useEffect(() => {
    dispatch(getTeacher(token, "", page));
  }, [page]);
  return (
    <Container style={{ marginTop: 100, textAlign: "left" }}>
      <TextField
        id="outlined-basic"
        label="Enter name"
        variant="outlined"
        value={search}
        color="secondary"
        onChange={(e) => setSearch(e.target.value)}
      />
      <br />
      <br />
      <div style={{ display: "flex" }}>
        <Button variant="contained" onClick={handleSearch} color="secondary">
          Primary
        </Button>
      </div>
      <br />
      <br />
      <MyTable teachers={teachers} handleTeacherClick={handleTeacherClick} />
    </Container>
  );
}
